INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(1, 17, , ''Hoysaleswara temple, also referred simply as the Halebidu temple, is a 12th-century Hindu temple dedicated to Shiva. It is the largest monument in Halebidu, a town in the state of Karnataka, India and the former capital of the Hoysala Empire.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(2, 16, , ''Shettihalli Church is located 2 km from Shettihalli, Hassan, in Karnataka. Built in the 1860s by the French missionaries in India, the church is a magnificent structure of Gothic Architecture. After the construction of the Hemavati Dam and Reservoir in 1960 the church was abandoned''),
(3, 19, , ''Hampi is an ancient village in the south Indian state of Karnataka. Its dotted with numerous ruined temple complexes from the Vijayanagara Empire. On the south bank of the River Tungabhadra is the 7th-century Hindu Virupaksha Temple, near the revived Hampi Bazaar. A carved stone chariot stands in front of the huge Vittala Temple site. Southeast of Hampi, Daroji Bear Sanctuary is home to the Indian sloth bear.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(5, 20, , ''Shravanabelagola is a town located near Channarayapatna of Hassan district in the Indian state of Karnataka and is 144 km from Bangalore.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(6, 21, , ''Belur, is a Town Municipal Council and taluka in Hassan district in the state of Karnataka, India. The town is renowned for its Chennakeshava Temple, one of the finest examples of Hoysala architecture.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(7, 22, , ''Halebidu is a town located in Hassan District, Karnataka, India. Halebidu was the regal capital of the Hoysala Empire in the 12th century. It is home to some of the best examples of Hoysala architecture. Most notable are the ornate Hoysaleshwara and Kedareshwara temples.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(8, 23, , ''Kateel or Kateelu is a temple town in the Dakshina Kannada district of the Indian state of Karnataka. It is considered one of the holiest Hindu temple towns in India. It is situated on the banks of the river Nandini.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(9, 24, , ''Dharmasthala is a town in the southwest Indian state of Karnataka. The centuries-old Sri Manjunatha Temple, dedicated to Lord Shiva, is a place of Hindu pilgrimage known for its large statue of the revered figure Bahubali. The Manjusha Museum''''s eclectic collection includes manuscripts and early wooden chariots. Nearby, the Car Museum features vintage automobiles, including a 1920s Studebaker used by Mahatma Gandhi.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(10, 25, , ''Kadri is a location in Mangalore city within the Corporation limits. Kadri is home to the famous Kadri Manjunath Temple. Kadri is also famous for its annual buffalo race known as Kambala. A famous personality from Kadri is Kadri Gopalnath. Nearby localities are Balebail and Derebail.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(12, 37, , ''This beach is on the shores of Arabian sea and is credited as one of the safest and best maintained beaches of India.[1] It is the most popular, well connected and most visited beach of coastal Karnataka.[2]'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(13, 38, , ''Murdeshwar is a town in Bhatkala Taluk of Uttara Kannada district in the state of Karnataka, India. Murdeshwar is famous for the worlds second tallest Shiva statue, the town lies on the coast of the Arabian Sea and is also famous for the Murdeshwar Temple.The statue is 123 feet in height and it took about 2 years to build. The idol is designed such that it gets the sunlight directly and thus appears sparkling. '');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(14, 39, , ''The Murudeshwar beach is a major tourist attraction in Karnataka. Surrounded by gentle hills and lush green foliage, this beach is always bustling with activity. The beauty of this place is enhanced by the coconut trees which are indigenous to this location.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(15, 40, , ''Mysore Palace is a historical palace and a royal residence at Mysore in the Indian State of Karnataka. It is the official residence of the Wadiyar dynasty and the seat of the Kingdom of Mysore. The palace is in the centre of Mysore, and faces the Chamundi Hills eastward. Mysore is commonly described as the ''''City of Palaces''''.Mysore Palace is now one of the most famous tourist attractions in India, after the Taj Mahal, with more than 6 million annual visitors.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(16, 42, , ''Kukke Subramanya is a Hindu temple located in the village of Subramanya, Karnataka. In this temple Kartikeya is worshipped as Subramanya,lord of all serpents. The epics relate that the divine serpent Vasuki and other serpents found refuge under Subramanya when threatened by the Garuda.'');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(17, 43, , ''Wonderla is one of the largest chain of amusement parks in India. It is owned and operated by Wonderla Holidays Limited which is headquartered near Bidadi, 28 kilometres from Bengaluru, Karnataka.The park features a wide variety of attractions including 55 land and water rides, a musical fountain and laser shows, and a virtual reality show.'');

